import React from "react";
import {add, sub, mult, div} from "./Calsy";

function App(){
    return (
    <>
    <ol>
        <li> Sum of Two Numbers are = {add(30,3)} </li>
        <li> Sub of Two Numbers are = {sub(30,3)} </li>
        <li> mul of Two Numbers are = {mult(30,3)} </li>
        <li> div of Two Numbers are = {div(34,3)} </li>
    </ol>
</>)
}

export default App;
